import React, { useState, useEffect } from 'react';
import '../css/Bikes.css';

const bikes = [
  // Bike objects go here (same as provided in the original code)
];

const BikesPage = () => {
  const [activeTab, setActiveTab] = useState('Bikes');
  const [numberPlateInput, setNumberPlateInput] = useState('');
  const [locationDisplay, setLocationDisplay] = useState('');
  const [wdLocationDisplay, setWdLocationDisplay] = useState('');

  useEffect(() => {
    createBikeCards();
    loadNumberPlateData();
  }, []);

  const openTab = (tabName) => {
    setActiveTab(tabName);
  };

  const createBikeCards = () => {
    // Create the bike cards as per the original JavaScript code logic
    // Dynamically generated JSX should go here
  };

  const loadNumberPlateData = () => {
    // Fetch and process number plate data logic goes here
  };

  const showBikeLocation = () => {
    getBikeLocation(numberPlateInput).then((location) => {
      setLocationDisplay(`Location: ${location}`);
    });
  };

  const getBikeLocation = async (numberPlate) => {
    const data = await fetch('numberPlates.json').then((res) => res.json());
    const prefix = extractPrefix(numberPlate);
    if (prefix) {
      return getLocationByPrefix(data, prefix);
    }
    return 'Invalid number plate';
  };

  const extractPrefix = (numberPlate) => {
    const match = numberPlate.match(/^[A-Z]+/i);
    return match ? match[0].slice(-2).toUpperCase() : null;
  };

  const getLocationByPrefix = (data, prefix) => {
    const entry = data.find((item) => item.prefix === prefix);
    return entry ? entry.location : 'Unknown location';
  };

  return (
    <div className="bikes-page">
      <div className="secondary-nav">
        <a
          className={`tablinks ${activeTab === 'Bikes' ? 'active' : ''}`}
          onClick={() => openTab('Bikes')}
        >
          Bikes
        </a>
        <a
          className={`tablinks ${activeTab === 'Table' ? 'active' : ''}`}
          onClick={() => openTab('Table')}
        >
          Number Plates
        </a>
        <a
          className={`tablinks ${activeTab === 'WDBikes' ? 'active' : ''}`}
          onClick={() => openTab('WDBikes')}
        >
          WD Bikes
        </a>
      </div>

      {activeTab === 'Bikes' && (
        <div className="tabcontent">
          <div className="bikes-container">
            {/* Bike cards will be dynamically generated here */}
          </div>
        </div>
      )}

      {activeTab === 'Table' && (
        <div className="tabcontent">
          <div className="location-tool" style={{ textAlign: 'center', marginBottom: '20px' }}>
            <input
              type="text"
              value={numberPlateInput}
              onChange={(e) => setNumberPlateInput(e.target.value.toUpperCase())}
              placeholder="Reg"
              style={{ padding: '10px', fontSize: '30px' }}
            />
            <button onClick={showBikeLocation} style={{ padding: '10px 20px', fontSize: '16px' }}>
              Search
            </button>
            <p style={{ marginTop: '15px', fontSize: '30px', fontWeight: 'bold' }}>{locationDisplay}</p>
          </div>

          <div className="table-wrapper">{/* Table columns will be dynamically generated here */}</div>
        </div>
      )}

      {activeTab === 'WDBikes' && (
        <div className="tabcontent">
          <div className="wd-bikes-container">
            <div className="location-tool" style={{ textAlign: 'center', marginBottom: '20px' }}>
              <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '1px' }}>
                <div>
                  <input
                    type="text"
                    id="frameNumberInput"
                    placeholder="Enter frame number"
                    style={{ padding: '10px', fontSize: '16px' }}
                  />
                  <button style={{ padding: '10px 20px', fontSize: '16px' }}>Search by Frame Number</button>
                </div>
                <div>
                  <input
                    type="text"
                    id="engineNumberInput"
                    placeholder="Enter engine number"
                    style={{ padding: '10px', fontSize: '16px' }}
                  />
                  <button style={{ padding: '10px 20px', fontSize: '16px' }}>Search by Engine Number</button>
                </div>
                <div>
                  <input
                    type="text"
                    id="serialNumberInput"
                    placeholder="Enter WD serial number"
                    style={{ padding: '10px', fontSize: '16px' }}
                  />
                  <button style={{ padding: '10px 20px', fontSize: '16px' }}>Search by Serial Number</button>
                </div>
              </div>
              <div style={{ marginTop: '20px' }}>{wdLocationDisplay}</div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default BikesPage;
